void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Define o centro do canvas
    vec2 center = iResolution.xy / 2.0;


    // Define as coordenadas dos três círculos
    vec2 circle1 = center + vec2(0.0, -85.0 + 10.0 * sin(iTime)); // ok
    vec2 circle2 = center + vec2(50.0, -50.0 + 50.0 * sin(iTime)); // ok
    vec2 circle3 = center + vec2(-10.0, -100.0 + 100.0 * sin(iTime)); // ok
    vec2 circle4 = center + vec2(100.0, -40.0 + 10.0 * sin(iTime)); // ok
    vec2 circle5 = center + vec2(150.0, -50.0 + 50.0 * sin(iTime * 5.)); 
    vec2 circle6 = center + vec2(-150.0, -130.0 + 50.0 * sin(iTime * 3.)); // ok
    vec2 circle7 = vec2(800., 266.);
    vec2 circle8 = center + vec2(-350.0, -80.0 + 200.0 * sin(iTime * 1.)); // ok

